  return (
    <Grid 
      bgColor="bgColor" 
      height="80vh" 
      margin="auto"
      addstyle={() => {
        return css`
          position:relative;
          top:80px;
        `;
      }}
      >aaas</Grid>
  );
};

export default CommunityWrite;
